import styled from 'styled-components';
import { Link } from 'react-router-dom';

const Utils = () => {
  return (
    <UtilWrap>
      <li>
        <Link to="/Login">로그인</Link>
      </li>
      <li>
        <Link to="/Signup">회원가입</Link>
      </li>
    </UtilWrap>
  );
};

const UtilWrap = styled.nav`
  li {
    margin-left: 5px;
    a {
      display: flex;
      align-items: center;
      height: 45px;
      padding: 0 1.5rem;
      border-radius: 45px;
      background: var(--gray-2);
      white-space: nowrap;
      &:hover {
        color: #ccc;
      }
    }
  }
`;

export default Utils;
